import Keywords from './components/Keywords/Keywords';
import Sites from './components/Sites/Sites';
import Settings from './components/Settings/Settings';
import './style/App.css';

function App() {
  return (
    <div className="App">
      <Keywords />
      <Sites />
      <Settings />
    </div>
  );
}

export default App;
